INSERT INTO `mauwebshell` (`MaWebshell`, `TenMau`, `ThongTin`, `NgayTaiLen`) VALUES
	(1, 'Simple shell', 'Simple Shell là một dạng webshell đơn giản, không có giao diện đồ họa mà chỉ sử dụng dòng lệnh để thực hiện các lệnh shell cơ bản (one-liner webshell), với mã nguồn nhẹ và dễ dàng tùy chỉnh.', '2024-10-17 15:45:59'),
	(2, 'c99shell', 'c99shell là một webshell nổi tiếng, thường được sử dụng trong các cuộc tấn công trên web. Nó cung cấp nhiều tính năng để kiểm soát máy chủ từ xa.', '2024-10-17 15:17:13'),
	(3, 'R57 Shell', 'Một script viết bằng PHP, nổi tiếng với khả năng tải lên và tải xuống tập tin, tạo backdoor, và kiểm soát cơ sở dữ liệu SQL', '2024-10-17 16:55:59'),
	(4, 'B374K Web Shell', 'Cung cấp khả năng điều khiển từ xa trái phép đối với máy chủ, cho phép kẻ tấn công thực thi lệnh, thao tác các chức năng của máy chủ và quản lý từ xa mà không cần sử dụng cPanel, kết nối bằng SSH, FTP, v.v', '2024-10-17 16:55:59'),
	(5, 'SimAttacker', 'SimAttacker webshell là một loại mã độc hại (webshell) thường được hacker sử dụng để chiếm quyền điều khiển hoặc thực hiện các hành động độc hại trên một hệ thống máy chủ web. Webshell này thường là một tệp PHP nhỏ gọn', '2024-10-17 16:55:59'),
	(6, 'Custom shell', 'Webshell custom là một webshell được thiết kế và tùy chỉnh theo yêu cầu cụ thể của người tạo ra nó, thay vì sử dụng các mẫu hoặc công cụ webshell phổ biến sẵn có', '2024-11-19 05:59:13'),
	(7, 'NULL', 'Không có mô tả', '2024-12-10 00:54:17');
